@import "reset";
@import "variables";
@import "info-section";
@import "home";
@import "resume";

* {
  box-sizing: border-box;
}

html,
body {
  font-size: 18px;
  background: $color1;
  font-family: "Barlow Semi Condensed", sans-serif;
  height: 100%;
}

// We are styling the .hamburger-icon, .primary-btn, and .ghost-btn buttons from the #content-area section in this main.scss file, instead of the _home.scss file, because we might use them in other places as well.

.menu-icon {
  position: fixed;
  right: 0;
  top: 36px;
  right: 36px;
  // You want to add this padding around the .hamburger-icon button so that users don't have to click on the button exactly right on top.  You also want to change the top and right values by removing 20px from each, which was the amount added by the padding.  This way your button does not change its location.
  padding: 20px;
  z-index: 11;

  .fas {
    font-size: 2rem;
    color: $color1;
  }
}

.primary-btn {
  text-decoration: none;
  background: $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color3;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-right: 15px;
  transition: $btnTransitions;

  &:hover {
    background: black;
  }
}

.ghost-btn {
  text-decoration: none;
  border: 4px solid $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color1;
  padding: 11px 26px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: $btnTransitions;

  &:hover {
    border-color: black;
    color: black;
    background: $color3;
  }
}

#menu {
  background: $color1;
  position: fixed;
  width: 100%;
  top: 0;
  bottom: 0;
  transform: translate3d(-100%, 0, 0);
  z-index: 10;
  display: flex;
  align-items: center;
  justify-content: center;
  opacity: 1;
  transition: all 0.5s ease-in-out;

  nav {
    width: 400px;
    text-align: center;

    a {
      font-size: 2.3rem;
      padding: 1rem;
      display: block;
      text-decoration: none;
      color: white;

      &:hover {
        color: $color5;
      }
    }
  }
}

.menu-active {
  .menu-icon {
    .fas {
      color: white;
    }
  }

  #menu {
    // width: 100%;
    // top: 0;
    // bottom: 0;
    transform: translate3d(0, 0, 0);
  }
}
